import React, { Component } from 'react';
import Nav from './components/Nav'
import NotFound from './components/NotFound'
import axios from 'axios'
import PhotoContainer from './components/PhotoContainer'

import './index.css';

import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';

import apiKey from './config'

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    };
  }


  componentDidMount() {
    axios.get('https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=1f8da2e2e56688eb397b68debe319f86&tags=waterfalls&per_page=24&format=json&nojsoncallback=1')
    .then(response => {
      this.setState({
        photos: response.data.data
      })

    })
    .catch(error => {
    console.log('Error fetching and parsing data', error);
})
  }

  render() {
    return (
      console.log(this.state.data),

    <BrowserRouter>
      <div class="container">
        <PhotoContainer data={this.state.gifs}/>

        <Switch>
          <Route path="/search" component={Nav}/>
          <Nav />
            <div class="photo-container">
              <h2>Results</h2>
                <Route component={NotFound}/>
            </div>
          </Switch>
        </div>
        </BrowserRouter>
  );
}
}

export default App;
